import React from 'react';

const styles = {
    img: {
        height: '500px', 
        width:'500px'
    }
}
const DisplayFeedImages = ({img}) => {
    return (
        <div className={"feedImgs"}>
            <img src={img} alt={" "} style={styles.img}/>
        </div>
    )
}

export default DisplayFeedImages;
